import React from 'react';
import Blog from './Blog'; // Import your Blog component

const MyPage = () => {
  return (
    <div style={dis}>
      <Blog title="First Blog" />
      <Blog title="Second Blog" />
      <Blog title="Second Blog" />
      <Blog title="Second Blog" />
    </div>
  );
};

export default MyPage;
